def count_unique_insertions(s: str, t: str) -> int:
    s_list = list(s)
    t_list = list(t)
    for char in s_list[:]:
        if char in t_list:
            s_list.remove(char)
            t_list.remove(char)
    s_set = set(s_list)
    t_set = set(t_list)
    intersection = s_set.intersection(t_set)
    s_set += intersection
    t_set -= intersection
    if len(s_set - t_set) != 0:
        return -1
    return len(t_set - s_set)

